const { combineRgb } = require('@companion-module/base');

function getPresets(instance) {
    const presets = [];

    const txtalign = 'center:bottom';
    const pngalign = 'center:top';
    const txtcolor = combineRgb(255, 255, 255);
    const bkgcolor = combineRgb(0, 0, 0);
    const feedbkgcolor = combineRgb(255, 204, 102);
    
	const transpng = "iVBORw0KGgoAAAANSUhEUgAAAEgAAAA6CAYAAAATBx+NAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAAAmSURBVHhe7cEBAQAAAIIg/69uSEAAAAAAAAAAAAAAAAAAAAAAp2pBegABf9j/KAAAAABJRU5ErkJggg==";
	const LogoPng = "";
	const BlackPng = "";
	const ClearPng = "";
	const PressStartPng = "";
	const PlayPng = "";
	const PausePng = "";
	const TogglePng = "";
	const PrevSchedulePng = "";
	const NextSchedulePng = "";
	const PrevBuildPng = "";
	const NextBuildPng = "";
	const SlideStartPng = "";
	const ConnectPng = "";
	//const LivePrevPng = "";
	const GotoSlidePng = "";
	const GotoSchedulePng = "";
	
    var startButton = { category: "Commands", text: "Pres Start", txtsize: "14", action: "presstart", feedback: "is_none", png64: PressStartPng };
	
    const buttons = [
        { category: 'Commands', text: '', txtsize: '14', action: 'logo', feedback: 'is_logo', png64: LogoPng },
        { category: 'Commands', text: '', txtsize: '14', action: 'black', feedback: 'is_black', png64: BlackPng },
        { category: 'Commands', text: '', txtsize: '14', action: 'clear', feedback: 'is_clear', png64: ClearPng },
        { category: "Commands", text: "", txtsize: "14", action: "play", feedback: "is_none", png64: PlayPng },
        { category: "Commands", text: "", txtsize: "14", action: "pause", feedback: "is_none", png64: PausePng},
        { category: "Commands", text: "", txtsize: "14", action: "toggle", feedback: "is_none", png64: TogglePng },
        { category: 'Commands', text: '', txtsize: '14', action: 'prevsched', feedback: 'is_none', png64: PrevSchedulePng },
        { category: 'Commands', text: '', txtsize: '14', action: 'nextsched', feedback: 'is_none', png64: NextSchedulePng },
        { category: 'Commands', text: '', txtsize: '14', action: 'prevbuild', feedback: 'is_none', png64: PrevBuildPng },
        { category: 'Commands', text: '', txtsize: '14', action: 'nextbuild', feedback: 'is_none', png64: NextBuildPng },
        { category: 'Commands', text: '', txtsize: '14', action: 'slidestart', feedback: 'is_none', png64: SlideStartPng },
        startButton,
        { category: 'Commands', text: '', txtsize: '14', action: 'connectezw', feedback: 'is_none', png64: ConnectPng },
        { category: 'Commands', text: '', txtsize: '14', action: 'gotoslide', feedback: 'is_none', png64: GotoSlidePng },
        { category: 'Commands', text: '', txtsize: '14', action: 'gotoschedule', feedback: 'is_none', png64: GotoSchedulePng },
        //{ category: 'Commands', text: 'Live Prev', txtsize: '14', action: 'live', feedback: 'is_livepreview', png64: LivePrevPng },
    ];

    buttons.forEach((button) => {
        let preset = {
            type: 'button',
            category: button.category,
            name: `${button.text} Command`,
            style: {
                text: button.text,
                size: button.txtsize,
                color: txtcolor,
                bgcolor: bkgcolor,
                png64: button.png64,
                pngalignment: pngalign,
                alignment: txtalign,
            },
            steps: [{
                down: [{
                    actionId: button.action,
                    options: {
                        id: `id_${button.action}`,
                    },
                }],
                up: [],
            }],
            feedbacks: [],
        };

        // Add additional action for "sched" buttons
        if (button.action.includes('sched')) {
            preset.steps[0].down.push({
                actionId: startButton.action,
                options: {
                    id: `id_${startButton.action}`,
                },
            });
        }

        // Add feedbacks
        if (button.feedback === 'is_logo' || button.feedback === 'is_black' || button.feedback === 'is_clear') { //|| button.feedback === 'is_livepreview'
            let newItem = {
                feedbackId: button.feedback,
                options: {},
                style: {
                    bgcolor: feedbkgcolor,
                    color: bkgcolor,
                    png64: button.png64,
                },
            };
            preset.feedbacks.push(newItem);
        }

        presets.push(preset);
    });

    return presets;
}

module.exports = { getPresets };